import React from 'react';

class Portfolio extends React.Component{
	render(){
		return(
	  	 React.createElement(
	  	 	"h2", 
	  	 	{ classname: "title"},
	  	 	"Welcome to Portfolio!"
	  	 	)
	  	)
	}
}
export default Portfolio;
